import Layout from "../components/Layout";
import Container from "@material-ui/core/Container";
import { Typography } from "@material-ui/core";
import { makeStyles } from "@material-ui/core/styles";

import Grid from "@material-ui/core/Grid";
import CardItem from "../components/CardItem";

const useStyles = makeStyles(theme => ({
  root: {
    flexGrow: 1
  },

  ayce: {
    textAlign: "center"
  }
}));

const freshRolls = [
  {
    id: 1,
    name: "Yellowtail Delight Roll",
    description:
      "spicy tuna, cucumber, yellowtail, jalapeno, red onion, masago, and ponzu sauce",
    price: 12.99,
    image: ""
  },
  {
    id: 2,
    name: "Hawaiian Roll",
    description:
      "spicy tuna, cucumber, yellowtail, jalapeno, red onion, masago, and ponzu sauce",
    price: 12.99,
    image: ""
  },
  {
    id: 3,
    name: "Cucumber Sashimi Roll",
    description:
      "spicy tuna, cucumber, yellowtail, jalapeno, red onion, masago, and ponzu sauce",
    price: 12.99,
    image: ""
  },
  {
    id: 4,
    name: "Sakura Roll",
    description:
      "spicy tuna, cucumber, yellowtail, jalapeno, red onion, masago, and ponzu sauce",
    price: 12.99,
    image: "../static/ph.png"
  }
];

export default function menu() {
  const classes = useStyles();
  return (
    <Layout>
      <Container maxWidth="lg">
        <div className={classes.root}>
          <Grid container spacing={2}>
            <Grid item xs={12}>
              <div className={classes.ayce}>
                <Typography variant="h6">Fresh Rolls</Typography>
              </div>
            </Grid>

            {freshRolls.map(freshRoll => (
              <Grid item xs={12} sm={6}>
                <CardItem
                  key={freshRoll.id}
                  itemName={{ text: `${freshRoll.name}` }}
                  itemDescription={{ text: `${freshRoll.description}` }}
                  itemImage={{ image: `${freshRoll.image}` }}
                ></CardItem>
              </Grid>
            ))}
          </Grid>
        </div>
      </Container>
    </Layout>
  );
}
